VALUES
	('1','family_kids',1,b'0','https://art-s.nflximg.net/5ec54/7155040931d0d5e913a24f093712902f9c55ec54.webp','5','2015-12-08',94,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','다른 행성에서 온 사랑스러운 부적응자와 인간 소녀 사이에 뜻밖의 우정이 싹튼다. 이제 외계인과 소녀는 인생을 바꿀 놀라운 여정을 시작한다.','홈','cEMxsiSB7c0',91,2015),
	('10','family_kids',3,b'0','https://art-s.nflximg.net/782a3/2315c5443913966356537a61c8bab58a32e782a3.webp','5','2015-11-24',106,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','조르주 레미의 고전 만화를 각색한 이 영화는 3D 모션 캡처 기술을 활용하여 겁 없는 젊은 기자 틴틴과 충직한 강아지 스노위의 모험을 생생히 그려낸다.','틴틴 유니콘호의 비밀','C9ONwJ8NyUE',41,2011),
	('11','horror',2,b'0','https://art-s.nflximg.net/b65de/d3f220eb68e66d8cf7fb5a675666da996aab65de.webp','12','2015-11-23',97,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','젊은 남자의 뇌를 먹고 그 안의 기억을 흡수하게 된 신생 좀비가 그 남자의 여자친구와 사랑에 빠진다.','웜바디스','ix0iVDAGExo',13,2013),
	('12','horror',4,b'0','https://art-s.nflximg.net/7b0f2/04f4efc3013ea510c8d5a850461542513f27b0f2.webp','12','2015-11-22',111,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','등골이 서늘해지는 실화. 뉴잉글랜드의 한 가족이 집에 머무는 영혼들을 마주하게 되는데…','컨저링','ZmJ_Djcidic',50,2013),
	('13','horror',2,b'0','https://art-s.nflximg.net/b8ae8/b1da6fccbae33d42258609461bc9f200a71b8ae8.webp','12','2015-11-16',119,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','폐기된 독성 화학물질로 인해 탄생한 돌연변이 괴물이 딸을 낚아채자 한강 매점 주인은 딸을 구하기 위해 숨 가쁘게 움직인다.','괴물','u2GGvrNo4HI',98,2006),
	('14','horror',1,b'0','https://art-s.nflximg.net/e0165/904a2af8a8746c170fecc57487057395d82e0165.webp','12','2015-10-12',108,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','2명의 강도가 한 남자와 자녀들을 인질로 잡는다. 멕시코 국경으로 달려가던 범죄자들은 한 술집에서 만나지만 이곳이 뱀파이어 소굴임은 알지 못한다.','황혼에서 새벽까지','gi_DHdFlXfM',77,1996),
	('15','horror',3,b'0','https://art-s.nflximg.net/ca04d/dc8f694e93c70af6683d0cf9a745c4458ddca04d.webp','12','2015-09-18',92,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','한 간호사는 자신이 방문하는 집이 이전에 발생한 2건의 살인사건으로 인해 저주에 걸렸으며, 이곳의 원혼들이 모든 방문자를 죽이리라는 사실을 알게 된다.','주온극장판1','pYblh3BSdh8',2,2002),
	('16','horror',0,b'0','https://art-s.nflximg.net/57620/33243e0a03bede1eb4fa54c3cbb8284c95157620.webp','12','2015-11-21',81,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','청각 장애가 있는 작가가 홀로 조용히 지내기 위해 숲으로 들어가지만 복면을 쓴 살인자가 등장하면서 그녀는 목숨을 지키기 위해 고독한 싸움을 시작한다.','허쉬','Q_P8WCbhC6s',35,2016),
	('17','horror',3,b'0','https://art-s.nflximg.net/ca2ea/109478d034be583bf376234d4d2511e65abca2ea.webp','12','2015-11-25',113,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','팀 버튼의 흥미진진하면서 괴기스러운 드라마에서는 수백 년의 잠에서 깨어난 뱀파이어가 후손들을 만나기 위해 폐허가 된 집으로 돌아온 이야기를 그린다.','다크 새도우','aJGwnnxpp4U',2,2012),
	('18','horror',1,b'0','https://art-s.nflximg.net/c81f0/3992a2b0676dc4436313869b16252a41151c81f0.webp','12','2015-09-23',119,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','잭 토런스는 비수기의 적막하고 으스스한 호텔에서 생활하며 서서히 광기에 빠져들게 되고, 부인과 어린 아들을 공포에 빠뜨린다.','샤이닝','bFsgmzUhtJg',82,1980),
	('19','horror',4,b'0','https://art-s.nflximg.net/46508/d8df77970e7f029701f6c7e8a52e839c8a046508.webp','12','2015-10-18',97,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','고전이 된 슬래셔 영화 《13일의 금요일》을 리메이크한 작품. 10대 캠프 지도 학생들이 가면을 쓴 살인마 제이슨 부히스의 분노에 불을 붙인다.','13일의 금요일','5Ank9oNPFmM',46,2009),
	('2','family_kids',3,b'0','https://art-s.nflximg.net/eb8d2/b7272b23f5b413a09510e85e8b7fdf1b2e8eb8d2.webp','5','2015-11-20',94,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','평화의 계곡이 위협을 받자 게으른 팬더 포는 용의 전사로의 자신의 운명을 받아들이고 쿵푸 영웅이 되기 위한 수련을 받게 된다.','쿵푸 펜더','rmDdLcbzlC0',47,2008),
	('20','horror',0,b'0','https://art-s.nflximg.net/3d7dc/014c15b74c63c95e92c70c356db7415b96f3d7dc.webp','12','2015-10-19',99,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','무시무시한 늑대인간 때문에 공포에 떠는 마을. 발레리는 두려움과 슬픔 속에서 어려운 사랑의 결정을 내린다.','레드 라이딩 후드','gLN79c8joho',74,2011),
	('21','drama',1,b'0','https://art-s.nflximg.net/b4192/b09739d855591a042bd204b75063181ce91b4192.webp','19','2015-09-19',122,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','정신병원에 잠시 있다 돌아온 팻은 부모님 집으로 들어가 아내를 되찾으려 하지만, 자신만큼이나 불안정한 성격의 여성을 만난다.','실버라이닝 플래이북','muDBh58-O5Q',29,2012),
	('22','drama',1,b'0','https://art-s.nflximg.net/8f20d/fdc65fcbf126b6b28001a579af6dc4f0e288f20d.webp','19','2015-11-27',118,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','아내가 이혼을 선언하자 칼은 마지못해 독신 생활을 직면하게 되고, 잘나가는 젊은 독신남에게 조언을 구한다.','크레이지, 스투피드, 러브','xucKLGMxQkg',43,2011),
	('23','drama',2,b'0','https://art-s.nflximg.net/12f1c/a38ea153b8779ef1789902a3b5846fe2b5212f1c.webp','19','2015-09-16',118,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','제약회사 영업사원 제이미는 남성 성 기능 강화 약 판매에서 우수한 실적을 달성하며 승승장구한다. 삶이 더없이 쉬운 그에게 예상치 못한 어려운 로맨스가 찾아온다.','러브&드럭스','1k6E1De4Wdg',16,2010),
	('24','drama',4,b'0','https://art-s.nflximg.net/64d8d/9e9e3071fad6e04cc8a87e01ab20c14614c64d8d.webp','12','2015-11-23',90,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','인공위성 잔해로 우주선이 파괴되면서 한 의료 기술자와 베테랑 우주 비행사가 지구와의 교신이 끊긴 채 우주에 남겨진다.','그래비티','Xd9HhbaqHhQ',73,2013),
	('25','drama',0,b'0','https://art-s.nflximg.net/b6cf8/be87baa5476758ba40026856d997e4c2f4eb6cf8.webp','12','2015-11-18',126,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','한 대학의 교수들이 학교 청소부가 수학 천재라는 사실을 발견하게 되면서 상담을 통해 그의 마음의 병을 치유하도록 도와준다.','굿 윌 헌팅','qPE9bXcGnNo',50,1997),
	('26','drama',3,b'0','https://art-s.nflximg.net/dd6ae/329e515706d2c44415ee384cbb1636d1658dd6ae.webp','12','2015-11-07',99,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','벤 셔우드의 흥미로운 소설이 원작이며 귀신이 등장하는 이 영화에서 주인공 찰리는 동생 샘이 죽은 이후에도 샘에게 헌신한다.','세인트 클라우드','xYvTI3hvDZA',1,2010),
