	('913','tv',3,b'1','https://art-s.nflximg.net/c9464/be7f985ef8ac01e967655ed1c4f7ada3ed3c9464.webp','15세 이상','2016-11-20',68,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','신종 테러의 위협으로부터 나라를 지키기 위해 국토안보부는 슈퍼 천재와 그의 괴짜 천재 팀을 소집한다.','스콜피온','qrAivSW9Lbc',412,2016),
	('914','tv',3,b'1','https://art-s.nflximg.net/e0ad9/149deeee89bf84723c5edec0a61151a1520e0ad9.jpg','15세 이상','2017-01-20',49,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','미국 시트콤의 고전을 리메이크했다. 고등학생 딸과 초등학생 아들을 친정 엄마의 도움 아닌 도움으로 키워가는 쿠바계 열혈 싱글맘. 그녀의 하루하루를 담았다.','원데이앳어타임','wNFFleycS8k',95,2017),
	('915','tv',3,b'1','https://art-s.nflximg.net/cf19d/73c41b984d45a8eee5331d75714b78d7c55cf19d.jpg','15세 이상','2016-05-10',57,'https://art-s.nflximg.net/69a47/8526d5254108173a3f71e9e2d5eaf92043669a47.webp','해병대 출신의 퇴역한 명사수 밥 리는 대통령 암살 음모를 저지해달라는 백악관의 요청을 받고 현업에 복귀하지만 곧 살인 누명을 쓰고 만다.','더블타켓','6ZVcPhDt-kM',675,2016),
